      function fill_path(ctx, fill, stroke, width) {
          if (fill) {
              ctx.fillStyle = fill;
              ctx.fill();
          }
  
          if (stroke) {
              ctx.lineWidth = width;
              ctx.strokeStyle = stroke;
              ctx.stroke();
          }
      }
  
      function round_rect(ctx, a, b, d, c, e) {
          d < 2 * e && (e = d / 2);
          c < 2 * e && (e = c / 2);
          0 > e && (e = 0);
  
          ctx.beginPath();
          ctx.moveTo(a + e, b);
          ctx.arcTo(a + d, b, a + d, b + c, e);
          ctx.arcTo(a + d, b + c, a, b + c, e);
          ctx.arcTo(a, b + c, a, b, e);
          ctx.arcTo(a, b, a + d, b, e);
          ctx.closePath();
      }
  
      function circle(ctx, x, y, r) {
          ctx.beginPath();
          ctx.arc(x, y, r, 0, PI2M);
      }
  
      function circle_angle(ctx, x, y, r, a) {
          ctx.beginPath();
          ctx.lineCap = "round";
          ctx.arc(x, y, r, 0, PI2M * a);
      }
  
      function round_regular_polygon(ctx, n, r, round) {
          var a = (PI2M) / n;
  
          ctx.beginPath();
  
          // pre-compute path
          var vertex = [{ x: r, y: 0 }];
          var middle = [];
          for (var i = 1; i < n; i++) {
              vertex.push({ x: window.Math.cos(i * a) * r, y: window.Math.sin(i * a) * r });
              var len = vertex.length;
              middle.push(Utils.middle_point(vertex[len - 2], vertex[len - 1]));
          }
          middle.push(Utils.middle_point(vertex[vertex.length - 1], vertex[0]));
  
          // compute path
          var v = middle[middle.length - 1];
          ctx.moveTo(v.x, v.y);
          for (var i = 0; i < n; i++) ctx.arcTo(vertex[i].x, vertex[i].y, middle[i].x, middle[i].y, round);
          ctx.closePath();
      }
  
      function create_rotated_img(r, img) {
          var can = window.document.createElement("canvas");
          var ctx = can.getContext("2d");
  
          var d = window.Math.sqrt(img.width * img.width + img.height * img.height);
          d2 = d / 2;
  
          can.width = d;
          can.height = d;
  
          ctx.translate(d2, d2);
          ctx.rotate(r);
          ctx.drawImage(img, -img.width / 2, -img.height / 2);
  
          return can;
      }
  
      function create_message(scale, msg) {
          var can = window.document.createElement("canvas");
          var ctx = can.getContext("2d");
  
          var h = window.Math.floor(scale * 28);
          var hf = window.Math.floor(scale * 20);
          ctx.font = hf + "px Baloo Paaji";
          var gap = 8 * scale;
          var w = ctx.measureText(msg).width + gap * 2;
  
          can.width = w;
          can.height = h;
  
          /* Draw background */
          round_rect(ctx, 0, 0, w, h, 10 * scale);
          ctx.globalAlpha = 0.5;
          fill_path(ctx, "#000000");
          ctx.globalAlpha = 1;
  
          /* Draw text */
          (ctx.textBaseline = "middle"), (ctx.font = hf + "px Baloo Paaji");
          ctx.beginPath();
          ctx.fillStyle = "#FFF";
          ctx.fillText(msg, gap, h / 2);
  
          return can;
      }
  
