      function init_fake_world() {
          window.document.getElementById("game_body").style.backgroundColor = SPRITE.GROUND[fake_world.time];
  
          fake_world.items.push(new Item(ITEMS.FIRE, 0, 0, 0, 0, window.Math.random() * PI2M, 2, 1));
          fake_world.items.push(new Item(ITEMS.FRUIT, 0, 0, 0, 0, 0, 0, 5));
          fake_world.items.push(new Item(ITEMS.WORKBENCH, 0, 0, 0, 0, PI4D, 0, 0));
          fake_world.items.push(new Item(ITEMS.FRUIT, 0, 0, 0, 0, 0, 0, 5));
      }
  
      function draw_fake_world() {
          var time = fake_world.time;
  
          if (sprite[SPRITE.HERB]) {
              ctx.drawImage(sprite[SPRITE.HERB][time][1], canw2 + 480, canh2 + 190);
              ctx.drawImage(sprite[SPRITE.HERB][time][2], canw2 + 180, canh2 - 430);
              ctx.drawImage(sprite[SPRITE.HERB][time][1], canw2 - 855, canh2 + 100);
              ctx.drawImage(sprite[SPRITE.HERB][time][0], canw2 - 550, canh2 - 300);
              ctx.drawImage(sprite[SPRITE.HERB][time][0], canw2 - 1020, canh2 - 520);
          }
  
          if (sprite[ItemType.STONE]) {
              ctx.drawImage(sprite[ItemType.STONE][time][1], canw2 - 80, canh2 - 640);
  
              ctx.drawImage(sprite[ItemType.STONE][time][1], canw2 + 80, canh2 + 490);
              ctx.drawImage(sprite[ItemType.STONE][time][2], canw2 - 180, canh2 - 700);
              ctx.drawImage(sprite[ItemType.STONE][time][0], canw2 + 550, canh2 + 100);
              ctx.drawImage(sprite[ItemType.STONE][time][1], canw2 + 450, canh2 + 300);
              ctx.drawImage(sprite[ItemType.STONE][time][1], canw2 + 780, canh2 + 300);
              ctx.drawImage(sprite[ItemType.STONE][time][2], canw2 + 980, canh2 + 200);
              ctx.drawImage(sprite[ItemType.STONE][time][2], canw2 + 680, canh2 + 600);
              ctx.drawImage(sprite[ItemType.STONE][time][2], canw2 - 380, canh2 + 100);
              ctx.drawImage(sprite[ItemType.STONE][time][2], canw2 + 280, canh2 + 250);
          }
  
          if (sprite[ItemType.BERRY]) {
              ctx.drawImage(sprite[ItemType.BERRY][time][0], canw2 - 590, canh2);
              ctx.drawImage(sprite[ItemType.BERRY][time][0], canw2 + 120, canh2 - 390);
              ctx.drawImage(sprite[ItemType.BERRY][time][0], canw2 - 270, canh2 + 340);
          }
  
          if (sprite[ItemType.WOOD]) {
              ctx.drawImage(sprite[ItemType.WOOD][time][4], canw2 - 700, canh2 - 600);
              ctx.drawImage(sprite[ItemType.WOOD][time][2], canw2 - 970, canh2 - 250);
              ctx.drawImage(sprite[ItemType.WOOD][time][5], canw2 - 720, canh2 - 200);
  
              ctx.drawImage(sprite[ItemType.WOOD][time][2], canw2 - 1020, canh2 + 340);
              ctx.drawImage(sprite[ItemType.WOOD][time][0], canw2 - 1120, canh2 - 0);
  
  
              ctx.drawImage(sprite[ItemType.WOOD][time][1], canw2 - 650, canh2 - 330);
              ctx.drawImage(sprite[ItemType.WOOD][time][4], canw2 - 495, canh2 - 90);
              ctx.drawImage(sprite[ItemType.WOOD][time][3], canw2 - 520, canh2 + 340);
              ctx.drawImage(sprite[ItemType.WOOD][time][2], canw2 + 830, canh2 - 520);
          }
  
          if (user && world) {
              /* Memorize previous camera position */
              var x = user.cam.x;
              var y = user.cam.y;
  
              /* Hardly center the camera */
              user.cam.x = canw2;
              user.cam.y = canh2;
  
              var real_time = world.time;
              world.time = fake_world.time;
              var items = fake_world.items;
  
              /* Draw a lost workbench ;_; */
              items[2].x = 400;
              items[2].y = 100;
              items[2].draw(ItemType.WORKBENCH);
  
              /* Draw tons of fruits */
              var fruits = items[1];
              fruits.x = -500;
              fruits.y = 100;
              fruits.fruits[0].x = fruits.x - 20.5;
              fruits.fruits[0].y = fruits.y - 22.5;
              fruits.fruits[1].x = fruits.x - 35.5;
              fruits.fruits[1].y = fruits.y + 7.5;
              fruits.fruits[2].x = fruits.x + 7.5;
              fruits.fruits[2].y = fruits.y - 30;
              fruits.fruits[3].x = fruits.x + 22.5;
              fruits.fruits[3].y = fruits.y;
              fruits.fruits[4].x = fruits.x - 7.5;
              fruits.fruits[4].y = fruits.y + 14.5;
              for (var i = 0; i < fruits.info; i++) {
                  fruits.fruits[i].draw(SPRITE.FRUIT);
              }
              var fruits = items[3];
              fruits.x = 210;
              fruits.y = -290;
              fruits.fruits[0].x = fruits.x - 20.5;
              fruits.fruits[0].y = fruits.y - 22.5;
              fruits.fruits[1].x = fruits.x - 35.5;
              fruits.fruits[1].y = fruits.y + 7.5;
              fruits.fruits[2].x = fruits.x + 7.5;
              fruits.fruits[2].y = fruits.y - 30;
              fruits.fruits[3].x = fruits.x + 22.5;
              fruits.fruits[3].y = fruits.y;
              fruits.fruits[4].x = fruits.x - 7.5;
              fruits.fruits[4].y = fruits.y + 14.5;
              for (var i = 0; i < fruits.info; i++) {
                  fruits.fruits[i].draw(SPRITE.FRUIT);
              }
  
              /* Draw fire */
              items[0].x = 450;
              items[0].y = -100;
              items[0].draw_bg(ItemType.FIRE);
              /*items[0].draw ();*/ items[0].draw_fg();
  
              /* Restore camera settings */
              user.cam.x = x;
              user.cam.y = y;
  
              /* Restore time */
              world.time = real_time;
          }
      }
  
