      /* Draw team buttons */
      function draw_team_buttons() {
          user.totem.id = -1;
          user.totem.pid = -1;
  
          if (user.totem.wait || user.zombie) return;
  
          var p = world.fast_units[user.id];
          var min = WORLD.DIST_TOTEM;
  
          if (p) {
              for (var i = 0; i < world.units[ITEMS.TOTEM].length; i++) {
                  var totem = world.units[ITEMS.TOTEM][i];
                  var m = Utils.dist(totem, p);
                  if (m < min) {
                      min = m;
                      user.totem.id = totem.id;
                      user.totem.pid = totem.pid;
                      user.totem.info = totem.info;
                      user.totem.lock = totem.info;
                  }
              }
          }
  
          /* Clean button state */
          var before = game.team_buttons_id;
          game.team_buttons_id = -1;
  
          if (user.totem.pid != -1 && (user.team.length == 0 || user.id == user.totem.pid)) {
              /* If user want to join the team */
              if (user.team.length == 0 && user.totem.info)
                  // It's full or locked (16)
                  game.team_buttons_id = CLIENT.TEAM_FULL;
              else if (user.team.length == 0) game.team_buttons_id = CLIENT.TEAM_JOIN;
              /* If the leader want to schedule the team */ else game.team_buttons_id = CLIENT.TEAM_MANAGE;
  
              /* Draw leave button, and player is not the leader */
          } else if (user.team.length != 0 && user.team[0] != user.id) game.team_buttons_id = CLIENT.TEAM_LEAVE;
          /* User can see the team */ else if (user.team.length != 0 && user.team[0] == user.id) game.team_buttons_id = CLIENT.TEAM_SHOW;
          else if (user.team.length != 0) game.team_buttons_id = CLIENT.TEAM_JOIN;
  
          /* Finally draw the button */
          if (game.team_buttons_id != -1) game.team_buttons[game.team_buttons_id].button.draw(ctx);
  
          var style = window.document.getElementById("team_box").style;
          if (game.team_buttons_id != -1 && game.team_buttons_id != before && style.display == "inline-block") game.team_buttons[game.team_buttons_id].action();
      }
  
      /* Draw chest inventory */
      function draw_chest_inventory() {
          /* Per default don't show a chest */
          user.chest.id = -1;
          user.chest.lock = false;
          user.chest.locked = false;
          user.chest.lockpick = false;
          user.chest.padlock = false;
          user.chest.open = false;
          var p = world.fast_units[user.id];
          var min = WORLD.DIST_CHEST;
  
          if (!p) return;
          for (var i = 0; i < world.units[ITEMS.CHEST].length; i++) {
              var chest = world.units[ITEMS.CHEST][i];
              var m = Utils.dist(chest, p);
              if (m < min) {
                  min = m;
                  user.chest.open = true;
                  user.chest.id = chest.extra;
                  user.chest.amount = chest.info;
                  user.chest.pid = chest.pid;
                  user.chest.locked = chest.lock;
                  user.chest.lock = chest.lock && user.id != chest.pid && !user.in_team(chest.pid) ? true : false;
                  user.chest.padlock = chest.pid === user.id && !user.chest.locked && user.inv.find_item(ItemType.LOCK) != -1 ? true : false;
                  if (user.chest.locked && user.inv.find_item(ItemType.LOCK_PICK) != -1) user.chest.lockpick = true;
              }
          }
  
          /* Draw chest button */
          if (min < WORLD.DIST_CHEST) {
              var img = sprite[SPRITE.CHEST_SLOT];
              var button = game.chest_buttons[ItemType.STONE_SWORD];
              var x = window.Math.floor(button.info.translate.x + (button.info.img[0].width - img.width) / 2);
              var y = window.Math.floor(button.info.translate.y + (button.info.img[0].height - img.height) / 2) + 3;
              ctxDrawImage(ctx, img, x, y);
  
              if (!user.chest.lock || user.chest.pid === user.id) {
                  if (user.chest.id >= 1) {
                      var button = game.chest_buttons[user.chest.id];
                      button.draw(ctx);
                      var n = user.chest.amount;
                      if (n > 1) draw_amount(n, button);
                  }
              }
  
              if (!user.chest.lock) {
                  if (user.chest.padlock) game.chest_padlock.draw(ctx);
              } else game.chest_locked.draw(ctx);
  
              if (user.chest.lockpick) game.chest_lockpick.draw(ctx);
          }
      }
  
      /* Draw bigmap */
      function draw_bigmap() {
          if (!user.bigmap) return;
  
          ctx.globalAlpha = 0.5;
          ctx.fillStyle = "#000000";
          ctx.fillRect(0, 0, canw, canh);
  
          ctx.globalAlpha = 0.8;
          var img = sprite[SPRITE.BIGMAP][world.time];
          var x = canw2 - img.width / 2;
          var y = canh2 - img.height / 2;
          ctxDrawImage(ctx, img, x, y);
          ctx.globalAlpha = 1;
  
          /* Draw marker on minimap */
          if (game.minimap.marker.x > -1) {
              ctx.fillStyle = "#660000";
              circle(ctx, x + game.minimap.marker.x * 3 * scale, y + game.minimap.marker.y * 3 * scale, scale * 14);
              ctx.fill();
          }
  
          /* Draw all players on minimap */
          var players = game.minimap.players;
          for (var i = 0; i < players.length; i++) {
              var p = players[i];
              ctx.fillStyle = !world.time ? "#ff0000" : "#ff0000";
              circle(ctx, x + 600 * (p.x / (world.nw * 100)) * scale, y + 600 * (p.y / (world.nh * 100)) * scale, scale * 6);
              ctx.fill();
          }
  
          /* Draw player on minimap */
          var u = world.fast_units[user.id];
          if (u) {
              ctx.fillStyle = !world.time ? "#e39716" : "#ffffff";
              circle(ctx, x + 600 * (u.x / (world.nw * 100)) * scale, y + 600 * (u.y / (world.nh * 100)) * scale, scale * 12);
              ctx.fill();
          }
      }
  
      function draw_reconnect() {
          if (user.reconnect.enabled) {
              ctx.globalAlpha = 0.9;
              ctx.fillStyle = "#000000";
              round_rect(ctx, canw2 - 150, canh2 - 90, 300, 180, 15);
              ctx.fill();
              ctx.globalAlpha = 1;
  
              var img = sprite[SPRITE.GEAR2];
  
              ctx.save();
              user.reconnect.rotate = (user.reconnect.rotate + delta * 2) % (PI2M);
              ctx.translate(canw / 2, canh / 2 - 25);
              ctx.rotate(user.reconnect.rotate);
              ctxDrawImage(ctx, img, -img.width / 2, -img.height / 2);
              ctx.restore();
  
              var img = sprite[SPRITE.RECONNECT];
              ctxDrawImage(ctx, img, (canw - img.width) / 2, (canh - img.height) / 2 + 25);
          }
      }
  
      /* Draw minimap */
