      /* Draw craft system part of the ui */
      function draw_ui_crafting() {
          var craft = user.craft;
  
          /* Draw preview crafting */
          if (!craft.crafting && craft.preview !== -2) {
              var u = world.fast_units[user.id];
              if (!u) return;
  
              ctx.save();
              if (INV_INFOS[craft.preview].grid === 0 && craft.mode === 0) {
                  ctx.translate(user.cam.x + u.x, user.cam.y + u.y);
                  ctx.rotate(u.angle);
                  ctx.translate(120, 0);
              } else {
                  var x = window.Math.floor(u.x + window.Math.cos(u.angle) * 120);
                  var y = window.Math.floor(u.y + window.Math.sin(u.angle) * 120);
                  x = user.cam.x + (x - (x % 100) + 50);
                  y = user.cam.y + (y - (y % 100) + 50);
                  ctx.translate(x, y);
              }
  
              var img = sprite[craft.preview][world.time];
              ctx.globalAlpha = 0.5;
              ctxDrawImage(ctx, img, -img.width / 2, -img.height / 2);
              ctx.globalAlpha = 1;
              ctx.restore();
  
              /* Some items work only with grid method */
              if (INV_INFOS[craft.preview].grid === 0) {
                  if (!craft.label[craft.mode]) {
                      if (craft.mode === 0) craft.label[0] = create_text(scale, LANG[TEXT.MODE_FREE], 20, "#e2c340");
                      else craft.label[1] = create_text(scale, LANG[TEXT.MODE_GRID], 20, "#e2c340");
                  }
  
                  var img = craft.label[craft.mode];
                  ctxDrawImage(ctx, img, canw2 + -img.width / 2, game.gauges.y - 26);
              }
          }
  
          /* Draw crafting progress */
          if (craft.crafting) {
              var ret = craft.timeout.update();
  
              /* Draw crafting buttons */
              for (var i = 0; i < craft.can_craft.length; i++) {
                  var button = craft.can_craft[i];
                  if (craft.id == button.id) {
                      var h = scale * 42;
                      var h2 = scale * 17;
                      round_rect(ctx, button.info.translate.x, button.info.translate.y + h * (1 - craft.timeout.v), button.info.width, h * craft.timeout.v + h2, scale * 10);
  
                      ctx.fillStyle = "#55B973";
                      ctx.fill();
                      ctx.globalAlpha = 0.8;
                      button.draw(ctx);
                  } else {
                      ctx.globalAlpha = 0.5;
                      button.draw(ctx);
                  }
  
                  ctx.globalAlpha = 1;
              }
  
              /* End animation control */
              if (ret) {
                  craft.crafting = false;
                  craft.timeout.v = 0;
                  craft.timeout.o = false;
              }
  
              return true;
          } else {
              /* Draw crafting buttons */
              for (var i = 0; i < craft.can_craft.length; i++) craft.can_craft[i].draw(ctx);
          }
  
          return false;
      }
  
