      function draw_bread_oven_smog() {
          ctx.save();
          ctx.translate(user.cam.x + this.x, user.cam.y + this.y);
          ctx.rotate(this.angle);
  
          if (this.info & 0x1f && this.info & 0x3e0 && (this.info & 0x7c00) != 0x7c00 && (this.smog.length == 0 || this.smog[this.smog.length - 1] <= SPRITE.SMOG_PUSH)) this.smog.push(SPRITE.SMOG);
  
          for (var i = 0; i < this.smog.length; i++) {
              this.smog[i] = window.Math.max(0, this.smog[i] - delta * SPRITE.SMOG_SPEED);
              ctx.globalAlpha = this.smog[i] / 1.3;
              var v = (1 - this.smog[i]) * 40;
              var r = (1 - this.smog[i]) * 35 + 10;
              circle(ctx, -68 * scale + window.Math.cos(-this.angle - window.Math.PI / 2) * v, -20 * scale + window.Math.sin(-this.angle - window.Math.PI / 2) * v, r);
              fill_path(ctx, "#333333");
          }
  
          ctx.globalAlpha = 1;
          if (this.smog.length > 0 && this.smog[0] === 0) this.smog.shift();
  
          ctx.restore();
      }
  
