      function draw_player_effect(p) {
          if (p.right >= 0) {
              switch (p.right) {
                  case ItemType.WATERING_CAN_FULL:
                      ctx.save();
  
                      var effect1 = (-3 * p.attack.v) / window.Math.PI;
                      if (p.attack.o) var effect2 = -window.Math.PI / 3 - (window.Math.PI / 3 + p.attack.v) / 3;
                      else var effect2 = p.attack.v;
  
                      ctx.rotate(p.angle - window.Math.PI / 2 + effect2);
  
                      ctx.globalAlpha = effect1 / 1.2;
                      circle(ctx, -40 * scale, 90 * scale, 5 * scale);
                      fill_path(ctx, "#0B6A84");
  
                      ctx.globalAlpha = effect1 / 1.2;
                      circle(ctx, -52 * scale, 100 * scale, 8 * scale);
                      fill_path(ctx, "#0B6A84");
  
                      ctx.globalAlpha = effect1 / 1.2;
                      circle(ctx, -30 * scale, 95 * scale, 4 * scale);
                      fill_path(ctx, "#0B6A84");
  
                      ctx.globalAlpha = 1;
                      ctx.restore();
                      break;
  
                  case ItemType.STONE_SHOVEL:
                  case ItemType.GOLD_SHOVEL:
                  case ItemType.DIAMOND_SHOVEL:
                  case ItemType.AMETHYST_SHOVEL:
                  case ItemType.REIDITE_SHOVEL:
                      if (p.fly === 1) break;
  
                      if (p.dist_winter > 0) var id = SPRITE.ICE_SHOVEL_CO[world.time];
                      else if (p.dist_sand > 0 || p.dist_desert > 0) var id = SPRITE.SAND_SHOVEL_CO[world.time];
                      else var id = SPRITE.GRD_SHOVEL_CO[world.time];
  
                      var effect1 = (-3 * p.attack.v) / window.Math.PI;
                      if (p.attack.o) var effect2 = window.Math.max(0.5 - effect1 / 2 + 0.5, 0);
                      else var effect2 = window.Math.max(effect1 / 2, 0);
  
                      if (effect2 === 0) p.angle_init = p.angle;
  
                      ctx.save();
                      ctx.rotate(p.angle_init - window.Math.PI / 2);
  
                      ctx.globalAlpha = effect1;
                      var effect3 = 25 * scale + effect2 * 25;
                      circle(ctx, effect3, 80 * scale, 15 * scale);
                      fill_path(ctx, id);
                      circle(ctx, -effect3, 80 * scale, 15 * scale);
                      fill_path(ctx, id);
                      ctx.globalAlpha = 1;
  
                      ctx.restore();
                      break;
              }
          }
      }
  
