                  if (world.mode === WORLD.MODE_ZOMBIES && world.players[user.id].skin === WORLD.ZOMBIE_SKIN) user.zombie = true;
                  else user.zombie = false;
  
                  /* Set vampire */
                  if (world.mode === WORLD.MODE_VAMPIRES && world.players[user.id].skin === WORLD.VAMPIRE_SKIN) user.vampire = true;
                  else user.vampire = false;
  
