          /* Blizzard status */
          blizzard_status(blizzard) {
              user.blizzard = blizzard;
          };
  
          /* Blizzard mode */
          blizzard(tempest) {
              user.winter.tempest = tempest;
  
              if (world.dist_winter > -300) {
                  if (tempest === 0) this.new_alert(LANG[TEXT.BLIZZARD_OFF]);
                  else this.new_alert(LANG[TEXT.BLIZZARD_ON]);
              }
          };
  
          /* Explorer quest resolution */
          explorer_quest(biome) {
              if (biome === 0) window.document.getElementById("exploreForest").src = "img/forest-leaf-ok.png";
              else if (biome === 1) window.document.getElementById("exploreWinter").src = "img/winter-flake-ok.png";
              else if (biome === 2) window.document.getElementById("exploreLava").src = "img/lava-volcano-ok.png";
              else if (biome === 3) window.document.getElementById("exploreDesert").src = "img/desert-cactus-ok.png";
          };
  
          /* Hide market */
          hide_market() {
              game.show_market = 0;
          };
  
          /* Hide quest */
          hide_quest() {
              game.show_quest = 0;
          };
  
          /* Clean player inventory and craft timer */
          clean_inventory() {
              /* Set inventory */
              user.inv.can_select = [];
              user.inv.n = [];
              user.inv.id = -1;
  
              /* Set drag system */
              user.inv.drag.stop();
  
              /* Set craft system */
              user.craft.can_craft = [];
              user.craft.crafting = false;
              user.craft.preview = -2;
              user.craft.id = -1;
              user.craft.workbench = false;
              user.craft.well = false;
              user.craft.fire = false;
              user.craft.water = false;
              user.craft.timeout = new LinearAnimation(false, 0, 1, 0, 1, 1);
          };
  
          /* Server talk to you */
          commands([cmd, succeed, answer, content]) {
              for (var i = 0; i < arguments.length; i++) {
                  if (typeof arguments[i] === "string") arguments[i] = Utils.escape_html(arguments[i]);
              }
  
              user.terminal.write_command(cmd, succeed, answer, content);
          };
  
          /* Server owner talk to you */
          message(msg) {
              /* Display message */
              this.new_alert(msg);
          };
  
          /* The password is wrong */
          wrong_password() {
              /* Old version, stop auto reconnection */
              window.clearTimeout(this.timeout_handler);
  
              /* Display error message */
              this.new_alert(LANG[TEXT.WRONG_PASSWORD]);
  
              /* User can take the control of ui interface again */
              ui.waiting = false;
          };
  
          /* Client version is too new */
          new_version() {
              /* Old version, stop auto reconnection */
              window.clearTimeout(this.timeout_handler);
  
              /* Display error message */
              this.new_alert(LANG[TEXT.NEW_VERSION]);
  
              /* User can take the control of ui interface again */
              ui.waiting = false;
          };
  
          /* Client version is too old */
          old_version() {
              /* Old version, stop auto reconnection */
              window.clearTimeout(this.timeout_handler);
  
              /* Display error message */
              this.new_alert(LANG[TEXT.OLD_VERSION]);
  
              /* User can take the control of ui interface again */
              ui.waiting = false;
          };
  
          /* Player get his bag */
          get_bag() {
              user.inv.update_bag_size(1, 0);
              game.update_inv_buttons();
          };
  
          // A player was just verified
          verified_account(ui8) {
              var id = ui8[1];
              var player = world.players[id];
              player.skin = ui8[2];
              player.accessory = ui8[3];
              player.baglook = ui8[4];
              player.book = ui8[5];
              player.level = ui8[6];
  
              var p = world.fast_units[id];
              if (p) {
                  p.skin = ui8[2];
                  p.accessory = ui8[3];
                  p.baglook = ui8[4];
                  p.book = ui8[5];
              }
          };
  
          /* Player terminate his craft */
          build_stop(id) {
              if (id === ItemType.BAG) {
                  user.inv.update_bag_size(1, 0);
                  game.update_inv_buttons();
              } else this.gather([0, id, 1]);
  
              /* Refresh craft buttons */
              user.craft.restart();
          };
  
          /* You can recycle your object */
          recycle_ok(id) {
              /* Reset delay of auto feed */
              user.auto_feed.delay = 0;
  
              user.craft.do_recycle(id);
          };
  
          /* You finished to recycle your item */
          recycle_stop(id) {
              var items = RECIPES[id].r;
  
              /* Take items from kit */
              for (var i = 0; i < items.length; i++) {
                  if (user.inv.max > user.inv.can_select.length || user.inv.n[items[i][0]] > 0) {
                      var amount = window.Math.floor(items[i][1] * 0.8);
                      if (!amount) continue;
                      this.gather([0, items[i][0], amount]);
                  }
              }
  
              /* Refresh craft buttons */
              user.craft.restart();
          };
  
          /* You can build your object */
          build_ok(id) {
              /* Reset delay of auto feed */
              user.auto_feed.delay = 0;
  
              user.craft.do_craft(id);
          };
  
          /* Stop attack */
          stop_attack() {
              send([14]);
          };
  
          /* Send attack */
          send_attack(angle) {
              send([4, window.Math.floor((((angle + PI2M) % PI2M) * 255) / PI2M)]);
          };
  
          /* Send angle */
          send_angle(angle) {
              send([3, window.Math.floor((((angle + PI2M) % PI2M) * 255) / PI2M)]);
          };
  
          /* Send move */
          send_move(move) {
              send([2, move]);
          };
  
          /* Send command message */
          send_command(buffer) {
              /* Send to the server */
              send([34, buffer]);
          };
  
          /* Send chat message */
          send_chat(buffer) {
              /* Print your message in the chat */
              var p = world.fast_units[user.id];
  
              p.text.push(buffer);
  
              /* Send to the server */
              send([0, buffer]);
          };
