                      this.baglook = isNaN(this.player.baglook) || this.player.baglook > 70 || this.player.baglook < 0 ? 1 : this.player.baglook;
                      this.book = isNaN(this.player.book) || this.player.book > 45 || this.player.book < 0 ? 1 : this.player.book;
                      this.accessory = isNaN(this.player.accessory) || this.player.book > 95 || this.player.accessory < 0 ? 1 : this.player.accessory;
  
