                          if (l === 0 || (l < SPRITE.GHOST_BUBBLES && bubbles[l - 1].life < 0.95)) bubbles.push({ id: window.Math.floor(window.Math.random() * sprite[SPRITE.BUBBLES][0].length), x: window.Math.floor(b.x + window.Math.random() * 80 - 40), y: window.Math.floor(b.y + window.Math.random() * 80 - 40), life: 1 });
  
                          /* Decrease opacity of bubbles */
                          for (var j = 0; j < l; j++) bubbles[j].life = window.Math.max(0, bubbles[j].life - delta);
  
