                  ui.bread = data["bread"];
      
                  var seasons = data["seasons"];
                  var lastSeason = seasons[seasons.length - 1];
      
                  ui.seasons = seasons;
      
                  _this.update_score(lastSeason["score"]);
                  ui.score = lastSeason["score"];
                  ui.kill = lastSeason["kill"];
